import React from 'react';
import classNames from 'classnames';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import InputAdornment from '@material-ui/core/InputAdornment';
import TextField from '@material-ui/core/TextField';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import MenuItem from '@material-ui/core/MenuItem';
import Typography from '@material-ui/core/Typography';
import {connect} from 'react-redux'
import {bindActionCreators} from 'redux'
import moment from 'moment';
import List from '@material-ui/core/List';
import ListItemText from '@material-ui/core/ListItemText';

const styles = theme => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  margin: {
    margin: theme.spacing.unit,
  },
  withoutLabel: {
    marginTop: theme.spacing.unit * 3,
  },
  textField: {
    flexBasis: 200,
  },
  card: {
    maxWidth: 445,
  },
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  manDateTime: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: 200,
  },
  
});

const paymentModeDD = [
  {
    value: 'CASH',
    label: 'CASH ON DELIVERY',
  },
  // {
  //   value: 'CREDIT CARD',
  //   label: 'CREDIT CARD',
  // },
  // {
  //   value: 'DEBIT CARD',
  //   label: 'DEBIT CARD',
  // },
];

class BookingConfirmation extends React.Component {
  continue = e => {
    e.preventDefault();
    this.props.nextStep();
  }

  render() {
    const { classes,handleChange,values} = this.props;
    return (
        
      <div className = {classes.root + " boodDeliveryMainDiv "}>
      <Card className={classes.card + " largeCard "}>
      <Typography component="h4" variant="h6" gutterBottom>
        Approximate Delivery Charge : 1000 INR. 
      </Typography>
        <List>
          <br/>
          <ListItemText className={" listItemReceipt "} primary="Pick Up" secondary={values.pickup} />
          <ListItemText className={" listItemReceipt "} primary="Drop" secondary={values.drop} />
          <ListItemText className={" listItemReceipt "} primary="When" secondary={values.when} />
          <ListItemText className={" listItemReceipt "} primary="Product Type" secondary={values.productType} />
          {this.props.productTypeOthersVisible &&
              <ListItemText className={" listItemReceipt "} primary="Other Product" secondary={values.otherProducts} />
          }
          <ListItemText className={" listItemReceipt "} primary="Tentative Weight" secondary={values.tentativeWeight} />
          <ListItemText className={" listItemReceipt "} primary="Delivery Date" secondary={values.deliveryDate + values.deliveryTime} />
          <ListItemText className={" listItemReceipt "} primary="Delivey Person" secondary={values.deliveryPerson} />
          <ListItemText className={" listItemReceipt "} primary="Delivery Person No" secondary={values.deliveryPersonNO} />
          <ListItemText className={" listItemReceipt "} primary="Payment Mode" secondary={values.paymentMode} />
          <ListItemText className={" listItemReceipt "} primary="Vehicle Type" secondary="MINI LORRY" />
          <ListItemText className={" listItemReceipt "} primary="Vehicle Name" secondary="MAHINDRA" />
          <ListItemText className={" listItemReceipt "} primary="Vehicle No" secondary="TN 06 5616" />
        </List>
        <br/>
        
        <TextField
        select
        className={classNames(classes.margin, classes.textField) + " fields "}
        value={values.paymentMode}
        label = "Payment Mode"
        // InputProps={{
        //     startAdornment: <InputAdornment position="start">PAYMENT MODE</InputAdornment>,
        // }}
        onChange = {handleChange('paymentMode')}
        >
        {paymentModeDD.map(option => (
            <MenuItem key={option.value} value={option.value}>
            {option.label}
            </MenuItem>
        ))}
        </TextField>
        <CardActions>
            <Button size="small" color="primary" className="button-lg" 
              onClick = {this.continue}>
                CONFIRM BOOKING
            </Button>
        </CardActions>
      </Card>
      </div>
    );
  }
}

BookingConfirmation.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(BookingConfirmation)
